import React from 'react'
function Alert(props) {
  return (
    props.alert && <div className='Container'><div className={`alert alert-${props.alert.type} alert-dismissible`} role="alert">
   <strong>{props.alert.msg}</strong> 
</div>
</div>
  )
}
export default Alert
